import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import "./css/mainHead.css";
import back from "./images/bubbles.svg";

const useStyle = makeStyles((theme) => ({
  mainPara: {
    color: "gray",
    marginTop: "25px",
  },
  customBtn: {
    marginTop: "25px",
    color: "white",
    backgroundColor: "#1b1b1b",
    "&:hover": {
      color: "black",
      backgroundColor: "white",
    },
  },
  customImage: {
    position: "absolute",
    top: 0,
    left: 0,
    zIndex: "-10",
  },
}));

const MainHead = () => {
  const classes = useStyle();
  return (
    <div>
      <Typography variant="h3">
        Velit officia consequat duis enim velit mollit.
      </Typography>
      <Typography variant="h5" className={classes.mainPara}>
        Exercitation veniam consequat sunt nostrud amet.
      </Typography>
      <Button
        size="large"
        variant="contained"
        classes={{ root: classes.customBtn }}
      >
        Explore Trendings
      </Button>

      <svg
        width="806"
        height="732"
        viewBox="0 0 806 732"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        <g id="Group 1">
          <circle
            id="Ellipse 4"
            cx="489"
            cy="483"
            r="215"
            fill="#6673EB"
            fill-opacity="0.16"
          />
          <circle
            id="Ellipse 3"
            cx="191"
            cy="270"
            r="270"
            fill="#FFC680"
            fill-opacity="0.49"
          />
          <circle
            id="Ellipse 5"
            cx="706"
            cy="632"
            r="100"
            fill="#FFC680"
            fill-opacity="0.2"
          />
        </g>
      </svg>

      <img src={back} alt="background" width="100%" height="80%" />
    </div>
  );
};

export default MainHead;
